(109, 0, '長靴をはいた猫', '0000-00-00', 10, '0000-00-00 00:00:00', 0, '', '軍師猫。策略に長けており権力者に取り入ったり、怪物を計略に陥れたりする。ついには主人を領主にすることに成功する。', 37, 0, '', '126.219.137.211', NULL, '2020-09-17 01:31:54'),
