(127, 0, '猫又', '0000-00-00', NULL, '0000-00-00 00:00:00', 0, '', '20年生きた老猫が化けるという。\n人を食らう化け猫になる場合もあれば、恩返しをする化け猫もいる。', 38, 0, '', '126.219.137.211', NULL, '2020-09-14 07:14:34'),
